import React, {Component} from "react";
import TemplateExpanded from '../../components/TemplateExpanded';
import TemplateComponentBlock from '../../components/TemplateComponentBlock';

export default class FindProBlock extends Component {

  constructor(props) {
    super(props);

    this.elements = [      
      `
      <!-- Find a pro block -->
      <div class="cardv2 cardv2__fpro">
      	<div class="cardv2__fpro__info">
      	</div>
      	<!--info-->

      	<div class="cardv2__fpro__glns">
      	</div>
      	<!--glns: glance-->

      	<div class="cardv2__fpro__rtg">
      	</div>
      	<!--rtg: ratings-->

      </div>
      <!-- /Find a pro block -->      
      <br><br><br><br><br>
      `,
    ];


    this.codeSnippets = [
`<!-- hero_landing_page -->
`,

    ];

  }

  render() {

    return (
      <TemplateExpanded
        pageTitle="Broker Header"
        activeParent="template_blocks"
        activeChild="find_pro_block">

        <TemplateComponentBlock hasContainer={false} blockTitle="Find a Pro" elements={this.elements[0]} codeSnippets={this.codeSnippets[0]} />

      </TemplateExpanded>
    )
  }

}
